import styles                   from './GradesTable.css';

export const GradesTable = ({ test, studentTests }) => {

    let numOfQuestions = 0;

    return (
        <>
            <table id="grades__table">
                <tbody>
                    <tr className="header_row space_under border_bottom">
                        <th>        ID                                      </th>
                        <th>        Respondent                              </th>
                        <th>        Submitted                               </th>
                        <th>        Number of Questions Answered            </th>
                        <th>        Grade                                   </th>
                    </tr>

                    {studentTests && studentTests.filter((studentTest) => studentTest.testID === test.testID).map((studentTest) => (                             
                        <tr>
                            <td> {  studentTest.stID         } </td>
                            <td> {  studentTest.studentName  } </td>
                            <td> {  studentTest.submitted    } </td>
                            <td> {  studentTest.questions.map((question) =>  question.answer === "" ? numOfQuestions++ : 0)} </td>
                            <td> {  studentTest.grade        } </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </>
    )
};
